import React from "react";


function BottomMenu(props) {

    return (
        <div className="bottomMenu">
            {props.bottomMenuItems.map((data) => {
                return <MenuItem
                    key={props}
                    name={props}
                    subModName={props.SetActiveSubModule}
                />
            })}
        </div>
    )
}

function MenuItem(props) {
    return <button onClick={props.subModName} name={props.name} className="button btn-botMenu">{props.name}</button>
}

export default BottomMenu;
